import "bootstrap/dist/css/bootstrap.min.css";
import "./css/style.css";
import React from "react";
import Header from "./components/Login/Header1";
import Container from "react-bootstrap/Container";
import Beitrag from "./components/Beitrag";
import Navbar1 from "./components/Navbar1";
import Button from "./components/Login/Button";
import Inputfield from "./components/Login/Inputfield";

function App() {
  return (
    <div>
      <Navbar1 className="m-0"></Navbar1>
      <Header str="Entdecke" className="m-0"></Header>
      <Container className="border bg-grey">
        <Beitrag name="Max" text="Hallo Welt"></Beitrag>
      </Container>

      <Container className="border p-4 grey hide">
        <Inputfield
          ueberschrift="Username"
          type="text"
          id="username"
          placeholder="zb. beispielname"
        ></Inputfield>
        <Inputfield
          ueberschrift="Passwort:"
          type="password"
          id="Userpasswort"
          placeholder="zb. beispielpasswort"
        ></Inputfield>
        <Inputfield
          ueberschrift="E-mail:"
          type="email"
          id="email"
          placeholder="zb. beispiel@beispiel.com"
        ></Inputfield>
        <Button variant="secondary" text="Registrieren"></Button>
      </Container>
    </div>
  );
}

export default App;
